var tipuesearch = {"pages": [{'title': '簡介', 'text': 'Cad2020倉儲 \n \n \n 40871106 \n', 'tags': '', 'url': '簡介.html'}, {'title': '發展', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n \n', 'tags': '', 'url': '發展.html'}, {'title': '進度', 'text': '\n', 'tags': '', 'url': '進度.html'}, {'title': 'W1建網頁', 'text': '首先先到 mde.tw  網站第一頁，點選下面連結 \n \xa0 \n 點選此檔案，裡面老師有詳細的教學內容 \n \xa0 \n 首先，先下載隨身系統 \n fall2020( 老師有做好的路徑及 pip 指令 )  \n \xa0 \n 或是直接至官網下載 \n \n 載完後解壓縮會有這四個檔案 \n \n 確認 python 版本 \n 在 Y 槽打上 python \n \n 確認版本候用 ctrl+Z 跳出 \n \xa0 \n 再確認擁有的 pip 附加檔案 \n \xa0 \n 再到git 官網下載portable git \n \n 將其下載下來 \n \n 並且解壓縮到data (自行新增一個新的資料夾) \n \n 將開始的路徑做更動(將其拉的小白) \n 打上 \n \n 此處路徑要一樣 \n 宣告變數函數path_git的路徑為%Disk%:\\portablegit\\bin; \n \xa0 \n 再路徑下多打上%path_git%;，才能拿來當作路徑使用 \n \xa0 \n 打完後做儲存，並重開 \n \xa0 \n 再來設定git config (有對應的語法必須查Google找git windows \n 例如要設定網路語法 \n \n 因為程式碼太多所以建議多做一個txt檔，存在data\\tmp下當參考資料 \n 例如: \n \n 再github 創建倉儲 \n \n 就會得到 三個檔案 \n \n 將檔案clone下來 \n \n 在tmp下就會得到 \n \n 並且裡面有 \n 再git資料夾理會有要存版本的資料 \n \xa0 \n 我現在希望再cad2020下的sumbugu做版本更動 \n \xa0 \n \xa0 \n \xa0 \n 所以到cad2020裡輸入 \n \n 再cad2020 下就會得到cmsimde的資料夾 \n 裡面有 \n \n 將up_dir的東西全部複製並貼到外面的cad2020裡 \n \n 取代up_dir資料夾裡的東西有.gitignore，LICENSE \n \xa0 \n \xa0 \n 在小黑下載啟動模組 \n \n pip安裝flask flask_cors lxml bs4 markdown鵜鶘leo\xa0 \n \xa0 \n \xa0 \n 補充:載完後解釋:leo \n \n 此處為leo設定的地方 \n \xa0 \n 之後即可開啟動態 \n \n 打上python wsgi.py \n 再google打上 http://localhost:9443/ \n 或是https://127.0.0.1:9443/ \n \n 即可登入  ( 密碼為admin \n 得網站 \n \n 在home中會要做一個.gitconfig \n 讓電腦知道要用哪知帳號 \n \xa0 \n 如果引擎壞掉如cmsimde網站無法開啟 \n \xa0 \n 打上git clone –recourse-submodule (“URL”) \n 網址= https：//github.com/40823131/cad2020 \n 要么 \n \xa0 \n 如果網址為[::]:9443 \n \n 到init.py改網址 \n \xa0 \n', 'tags': '', 'url': 'W1建網頁.html'}, {'title': 'W2', 'text': '', 'tags': '', 'url': 'W2.html'}, {'title': 'pdf 1個視頻', 'text': '\n', 'tags': '', 'url': 'pdf 1個視頻.html'}, {'title': 'pdf 2影片', 'text': '\n', 'tags': '', 'url': 'pdf 2影片.html'}, {'title': 'W3', 'text': '放假！ \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': 'ssh \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W5', 'text': 'API為Application Program Interface英文縮寫, 意為應用編程接口 \n SOLIDWORKS應用程序編程接口（API）是SOLIDWORKS軟件的COM編程接口。 \n 和操作使用軟件本身的功能一樣，屬於應用手法的一種。一般的操作是：通過鼠標點擊，鍵盤鍵入數字操作它現有的按鈕，命令；而API 則是通過編程語言代碼，對現有的功能進行一定的控制，形成新的命令或功能，即利用編程代碼來操控軟件的現有功能 \n 該API包含數百種函數，您可以從Visual Basic（VB），Visual Basic for Applications（VBA），VB.NET，C ++，C＃或SOLIDWORKS宏文件中調用。 \n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '\n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '\n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '\n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '\n', 'tags': '', 'url': 'W9.html'}, {'title': 'W10', 'text': '\n', 'tags': '', 'url': 'W10.html'}, {'title': 'W11', 'text': '\n', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '\n \n \n', 'tags': '', 'url': 'W12.html'}]};